  let Component
  switch (window.location.pathname) {
    case '/':
      Component = Home
      break
    case '/music':
      Component = Music
      break
    case '/contacts':
      Component = Contacts
      break
    case '/books':
      Component = Books
      break 
    case '/about':
    Component = About

  }

